                    fullDescription={item.fullDescription}
                    additionalInfo={item.additionalInfo}
                    difficulty={item.difficulty}
                    meetingPoint={item.meetingPoint}
                    key={index}
                />
            ))} */}
            <button type="button" className="btn btn-secondary w-100 m-1">
                Search
            </button>
        </div>
    );
}
